Join us in supporting efforts to stop the Port of Paracas from transporting, storing, and exporting toxic ore concentrate cargo through the Paracas National Reserve in Peru.
“The Paracas shipping port wants to transport, store, and export ore concentrate. This material is highly toxic. All this cargo will travel through the Paracas National Reserve in Peru where thousands of species, some in danger of extinction, live. The most well-known of these species include dolphins, penguins, sea lions, flamingos, pelicans, and sea turtles. Paracas has been a zone of migration for more than 200 species of birds from all around the world for years, dating back to before pre-Incan civilizations. 36 species of mammals, 10 species of reptiles, and 168 species of fish, among others, call the Paracas home, making it a key unique ecosystem at a global level.”
